// src/data/loads.ts
//
// Foundation load database for tower-crane spread footing design.
//
// Data sources (service-level foundation reactions, FEM (LN 303)):
// - 1000 EC-H 40 Litronic, Tower system 1000HC: jib 34.5-80.0 m, tower sections 0-22, without climbing equipment.
// - 1000 EC-H 40 Litronic (2-fall version sheet): jib 85.0 m and 90.0 m, tower sections 0-11, without climbing equipment.
// - 630 EC-H 40/20 Litronic, Tower system 500HC/630EC-H: jib 37.4-81.4 m, tower sections 0-10, without climbing equipment.
// - 470 EC-B 16, Tower system 24HC630: jib 24.4-83.0 m, tower sections 0-27, without climbing equipment.
//
// Database supports 4 mandatory service load cases per configuration,
// plus slewing torque T (kip-ft) which varies by crane model/jib and is applied to:
// - "operation" and "erection" only.
//
// Unit conventions (imperial):
//  Pu: kips (downward +)
//  M_kipft: kip-ft (resultant overturning moment magnitude)
//  V_k: kips (resultant horizontal force magnitude)
//  T_slew: kip-ft (about vertical axis)

export type CaseActions = { Pu: number; M_kipft: number; V_k: number };

export type LoadCaseName = "operation" | "stormFront" | "stormRear" | "erection";

export type LoadCases = Record<LoadCaseName, CaseActions>;

export type LoadRecord = {
  model: string;
  jibLength: number; // ft (nominal; derived from metric tables)
  towerSections: number; // count
  hookHeight_ft: number; // height under hook (HUH), ft
  slewTorque_kipft: number; // service slewing torque, applied to operation+erection
  cases: LoadCases;
};

// Notes from manufacturer tables:
// - Liebherr foundation tables provide one horizontal force H and one overturning moment M for each load case.
// - Loads here are stored as resultants so the analysis can apply them along the most unfavorable axes.

// ----------------------------
// Raw metric tables (as-published)
// ----------------------------
type RawJibBlock = {
  jib_m: number;
  mt_kNm: number; // slewing moment in assembly & operation
  // rows: [towerSections, hookHeight_m, opM,opH,opV, rearM,rearH,rearV, frontM,frontH,frontV, erectM,erectH,erectV]
  rows: number[][];
};

