// ----------------------------
// Metric to Imperial conversion
// ----------------------------
const KN_TO_KIP = 0.22480894387096;
const KNM_TO_KIPFT = 0.7375621492772656;
const M_TO_FT = 3.280839895013123;

function roundN(x: number, n: number): number {
  const p = Math.pow(10, n);
  return Math.round(x * p) / p;
}

function toCaseActions(M_kNm: number, H_kN: number, V_kN: number): CaseActions {
  return {
    Pu: roundN(V_kN * KN_TO_KIP, 3),
    M_kipft: roundN(M_kNm * KNM_TO_KIPFT, 3),
    V_k: roundN(H_kN * KN_TO_KIP, 3)
  };
}

// Build the flattened, imperial database used by the app.
function buildLoadDatabase(model: string, blocks: RawJibBlock[]): LoadRecord[] {
  return blocks.flatMap((blk) => {
    const jib_ft = roundN(blk.jib_m * M_TO_FT, 1);
    const slewTorque_kipft = roundN(blk.mt_kNm * KNM_TO_KIPFT, 3);

    return blk.rows.map((r) => {
      const towerSections = r[0];
      const hookHeight_ft = roundN(r[1] * M_TO_FT, 1);

      const op = toCaseActions(r[2], r[3], r[4]);
      const rear = toCaseActions(r[5], r[6], r[7]);
      const front = toCaseActions(r[8], r[9], r[10]);
      const erect = toCaseActions(r[11], r[12], r[13]);

      return {
        model,
        jibLength: jib_ft,
        towerSections,
        hookHeight_ft,
        slewTorque_kipft,
        cases: {
          operation: op,
          stormFront: front,
          stormRear: rear,
          erection: erect
        }
      };
    });
  });
}

export const loadDatabase: LoadRecord[] = [
  ...buildLoadDatabase("1000 EC-H 40", RAW_1000ECH40),
  ...buildLoadDatabase("630 EC-H", RAW_630ECH),
  ...buildLoadDatabase("470 EC-B", RAW_470ECB)
];

// Matching with tolerance because metric-imperial conversion yields non-integer jib lengths in ft.
const JIB_TOL_FT = 0.25; // ft
function sameNumber(a: number, b: number, tol = 0): boolean {
  return Math.abs(a - b) <= tol;
}

export function getLoadRecord(model: string, jibLength: number, towerSections: number): LoadRecord {
  const rec = loadDatabase.find(
    (r) =>
      r.model === model &&
      sameNumber(r.jibLength, jibLength, JIB_TOL_FT) &&
      sameNumber(r.towerSections, towerSections, 0)
  );
  if (!rec) {
    throw new Error(
      `No record for model="${model}", jibLength=${jibLength} ft (+/-${JIB_TOL_FT}), towerSections=${towerSections}.`
    );
  }
  return rec;
}
